import { BrowserRouter, Route, Routes, Switch} from "react-router-dom";

import Principal from './Principal/index.js';
import Cadastro from './Cadastro/index.js';
import Login from './Login/index.js';

const Rotas = () => {
    return (
        <BrowserRouter>
        <Routes>
        <Route exact={true} path="/Principal/index.js" component={Principal}/>
        <Route exact={true} path="/Cadastro/index.js" component={Cadastro}/>
        <Route exact={true} path="/Login/index.js" component={Login}/>
        </Routes>
        </BrowserRouter>

    )
}

export default Rotas;
